import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <nav>
            <Link to="/">Home</Link> 
            <Link to="/artistList">Artist</Link> 
            <Link to="/add">Add artist</Link>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
